import styled from "styled-components";
import React from "react";

const PlaylistDetailContainer = styled.div`
    display: flex;
    flex-direction: column;
`
const FormularioMusica = styled.div`
    display: flex;
    width: 100vw;
    height: 100px;
    align-items: center;
    justify-content: space-around;
`

export default class PlaylistDetail extends React.Component {
    state = {

    }
    
    render() {
        return (
            <PlaylistDetailContainer>
                <FormularioMusica>
                <div>
                        <label>Nome da Música</label>
                        <input />
                    </div>
                    <div>
                        <label>Artista</label>
                        <input />
                    </div>
                    <div>
                        <label>URL da música</label>
                        <input />
                    </div>
                    <button type="submit">Adicionar Música</button>
                </FormularioMusica>                    
                <button onClick={() => this.props.mudarPagina("playlists")}>Voltar para Playlists</button>
            </PlaylistDetailContainer>
        );
    }
}
